import { React, useState } from "react"
import { useParams } from "react-router";
import konyv3 from "../assets/konyvek/konyv3.jpg"
import "./Termek.css"
//import { Termekek } from "../assets/scripts/termekek";

function Termek() {
    const productId = useParams(); // URL-ből kiolvassuk az ID-t
    var Termekek = [{
        id: 2,
        Image: konyv3,
        Name: "konyv3",
        Price: 300,
        Distance: 30,
    },{
        id: 3,
        Image: konyv3,
        Name: "konyv3",
        Price: 300,
        Distance: 30,
    }, {
        id: 4,
        Image: konyv3,
        Name: "konyv3",
        Price: 300,
        Distance: 30,
    }]
    const product = Termekek.find(p => p.id == productId.termekId); // Megkeressük a terméket
    return (
        <div className="maintermek">
            <div>
                <img src={product.Image} alt="" />
            </div>
            <div>

            </div>
        </div>
    );
};

export default Termek;
